    // Zapowiedź ogólna (intro)
    const introAudioUrl = "https://kmwawa.github.io/zapowiedzi-3/PRZYSTANEK.mp3";

    function getDistance(lat1, lon1, lat2, lon2) {
      const R = 6371e3;
      const toRad = deg => deg * Math.PI / 180;
      const dLat = toRad(lat2 - lat1);
      const dLon = toRad(lon2 - lon1);
      const a = Math.sin(dLat / 2) ** 2 +
                Math.cos(toRad(lat1)) * Math.cos(toRad(lat2)) *
                Math.sin(dLon / 2) ** 2;
      const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
      return R * c;
    }

    function playSequence(introUrl, stopUrl) {
      const introAudio = new Audio(introUrl);
      const stopAudio = new Audio(stopUrl);

      introAudio.play().then(() => {
        introAudio.onended = () => {
          stopAudio.play().catch(e => console.error("Błąd odtwarzania przystanku:", e));
        };
      }).catch(e => console.error("Błąd odtwarzania intro:", e));
    }

    function checkLocation(position) {
      const lat = position.coords.latitude;
      const lon = position.coords.longitude;

      let statusText = `📍 Pozycja: ${lat.toFixed(5)}, ${lon.toFixed(5)}\n`;

      for (const [name, stopLat, stopLon, stopAudioUrl] of stops) {
        const distance = getDistance(lat, lon, stopLat, stopLon);
        statusText += `➡️ ${name}: ${distance.toFixed(1)} m\n`;

        if (distance <= 20 && !announcedStops.has(name)) {
          playSequence(introAudioUrl, stopAudioUrl);
          announcedStops.add(name);
        }
      }

      document.getElementById('status').textContent = statusText;
    }

    function handleError(error) {
      document.getElementById('status').textContent = "❌ Błąd geolokalizacji: " + error.message;
    }

    function startTracking() {
      if (!navigator.geolocation) {
        alert("Twoja przeglądarka nie obsługuje geolokalizacji.");
        return;
      }

      document.getElementById('status').textContent = "📡 Śledzenie rozpoczęte...";

      navigator.geolocation.watchPosition(checkLocation, handleError, {
        enableHighAccuracy: true,
        maximumAge: 0,
        timeout: 10000
      });
    }
  </script>
